// src/components/About.js
import React from 'react';
import './About.css';

function About() {
  return (
    <div className="about">
      <h2 className="about__title">Sobre Nosotros</h2>
      <p className="about__text">En Fertisher WMS nos especializamos en ofrecer soluciones avanzadas de gestión de almacenes diseñadas para optimizar la logística y mejorar la eficiencia operativa de nuestros clientes. Con años de experiencia en el sector, nos hemos consolidado como líderes en la industria gracias a nuestra dedicación a la innovación y nuestro compromiso con la excelencia.</p>
    </div>
  );
}

export default About;
